import React, {useEffect, useState} from 'react';
import { useParams } from 'react-router-dom';

const FinalPage = () => {
  const { packageId } = useParams();
  const [packageData, setPackageData] = useState(null);
  useEffect(() => {
    const fetchPackage = async () => {
      try {
        const response = await fetch(`http://localhost:8080/api/v1/packages/${packageId}`);
        const data = await response.json();
        setPackageData(data);
      } catch (error) {
        console.error('Error fetching package:', error);
      }
    };

    fetchPackage();
  }, [packageId]);
  return (
    <div className='bg-gray-100 min-h-screen py-40 flex text-primary'>
      <h1>Final Page</h1>
      <p>Encomenda feita com sucesso!</p>
      <p>Número da encomenda: {packageId}</p>
      {packageData && (
        <div>
          <p>Nome do cliente: {packageData.userName}</p>
          <p>Email do cliente: {packageData.userEmail}</p>
          {/* Exiba outros dados da encomenda aqui */}
        </div>
      )}
    </div>
  );
};

export default FinalPage;
